import React from 'react';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Col from 'react-bootstrap/Col';
import FormCheck from 'react-bootstrap/FormCheck'
// import AuthContext from '../../context/auth-context';
import './CreateUserForm.css';

const UpdateUserForm = (props) => {

console.log({...props});
const {...user} = props.user;
console.log({...user});

function handleInputChange(e) {
  console.log("oi oi savaloy");

}

return (
<div className="UpdateFormContainer">
<Form onSubmit={props.onConfirm}>
<Form.Row>
  <Form.Group as={Col} controlId="formGridEmail">
    <Form.Label>Email</Form.Label>
    <Form.Control type="email" placeholder="Enter email" value={user.email}/>
  </Form.Group>

  <Form.Group as={Col} controlId="formGridPassword">
    <Form.Label>Password</Form.Label>
    <Form.Control type="password" placeholder="Password" value={user.password}/>
  </Form.Group>
</Form.Row>

<Form.Group controlId="formGridName">
  <Form.Label>Name</Form.Label>
  <Form.Control type="text" placeholder="Name" value={user.name}/>
</Form.Group>

<Form.Group controlId="formGridRole">
  <Form.Label>Role</Form.Label>
  <Form.Control placeholder="role" value={user.role} onChange={handleInputChange()}/>
</Form.Group>

<Form.Row>
  <Form.Group as={Col} controlId="formGridCity">
    <Form.Label>City</Form.Label>
    <Form.Control />
  </Form.Group>

  <Form.Group as={Col} controlId="formGridState">
    <Form.Label>State</Form.Label>
    <Form.Control as="select">
      <option>Choose...</option>
      <option>...</option>
    </Form.Control>
  </Form.Group>

  <Form.Group as={Col} controlId="formGridZip">
    <Form.Label>Zip</Form.Label>
    <Form.Control />
  </Form.Group>
</Form.Row>

<Form.Group id="formGridCheckbox">
  <Form.Check type="checkbox" label="Check me out" />
</Form.Group>

{props.canCancel && (
  <Button variant="primary" onClick={props.onCancel}>
  Cancel
  </Button>
)}

{props.canConfirm && (
  <Button variant="secondary" type="submit" >
  Submit
  </Button>
)}

</Form>
{
  // onChange ={ (e) => {
  // console.log("dynamic value change from prefilled:  ", this.state.value);
  // }

  // <AuthContext.Consumer>
// </AuthContext.Consumer>
}
</div>

)};

export default UpdateUserForm;
